      email:'sdfs',
    },
    {
      id: 3,
      username: 'zzzz',
      email:'sdfs',
    }
  ]

const User = ({user}) => {
  return (
    <div>
      <b>{user.username}</b><span>({user.email})</span>
    </div>
  )
}

